import React from 'react';
import Header from "../components/Header";
import '../css/Services.css';

function Services() {
  const servicesList = [
    "Fence Painting and Staining",
    "Deck Painting and Staining",
    "Pressure Washing",
    "Manual and Mechanical Sanding",
    "Wood Filling",
    "Wood Preserving",
    "Minor Wood Repairs",
    "Warranty and Follow-Up Services"
  ]

  const packagesList = [
    "Basic: Pressure Wash Clean, Detailed Sanding, Painting or Staining",
    "Premium: Pressure Wash Clean, Detailed Sanding, Wood Repair and Filling, Painting or Staining, Warranty"
  ]

  return (
    <div className="services">
      <Header title="All the Services We Provide" />
      <div className="services">
        {servicesList.map((service, index) => (
          <div className="serviceItem" key={index}>
            <span className="serviceIcon">âœ“</span>
            {service}
          </div>
        ))}
      </div>
      <div className="packages">
        <h1>Packages</h1>
        {packagesList.map((pkg, index) => (
          <div className="packageItem" key={index}>
            {pkg}
          </div>
        ))}
      </div>
    </div>
  )
}

export default Services
